import React from 'react'
import {ReactComponent as TelefoneFooter} from "./images/Phone.svg";
const Footer = () => {
  return (
    <div  id="footer">
        <div class="leftFooter">
            <h4>Ecommerce Fetech Informatica Teste</h4>
            <p>Teste Paragrafo</p>
            <TelefoneFooter />
        </div>
    </div>
  )
}
export default Footer;
